import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card, CardContent, Chip, Container, Grid, Typography } from '@mui/material';

function PatientsBooking() {
  const [doctorAvailability, setDoctorAvailability] = useState([]);
  console.log(doctorAvailability);

  useEffect(() => {
    axios.get('http://localhost:5000/api/v3/getAvailability')
      .then(response => {
        setDoctorAvailability(response.data);
      })
      .catch(error => {
        console.error('Error fetching availability:', error);
      });
  }, []);

  return (
    <Container maxWidth="md">
   

    </Container>
  );
}

export default PatientsBooking;
